def lbs(seq): 
    # If the length of the sequence is 1, return the sequence.
    if len(seq) == 1: 
        return seq
    # Create a hash table to keep track of the longest bitonic sequence found so far.
    d = {}
    for i in range(len(seq)): 
        if (seq[i] not in d): 
            d[seq[i]] = 0
        d[seq[i]] += 1
    # Find the longest sequence in the hash table.
    max_length = d[' ']
    if max_length > 0: 
        return max(seq[seq.index(max_length)] + max_length, max_length)
    else: 
        return max(seq)
